import { Component, Inject, OnInit } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';
import { MatDialogRef, MAT_DIALOG_DATA } from '@angular/material/dialog';
import { Workspace } from '@dashboard/interfaces/workspace.interface';
import { RouterExtensionsService } from '@main/services/router-extensions.service';
import { Status } from '@tasks/interfaces/status.interface';
import { Observable } from 'rxjs';
import { requiredValidator } from '../../../_main/validators/required.validator';

export interface AddMemberDialogData {
  workspaceId: number;
  projectId?: number;
}

@Component({
  selector: 'app-add-member-dialog',
  templateUrl: './add-member.dialog.html',
  styleUrls: ['./add-member.dialog.scss'],
})
export class AddMemberDialog implements OnInit {
  public statusList$!: Observable<Status[]>;
  public workspaceList$!: Observable<Workspace[]>;

  public form = new FormGroup({
    email: new FormControl('', [requiredValidator()]),
  });

  constructor(
    @Inject(MAT_DIALOG_DATA) public data: AddMemberDialogData,
    private dialogRef: MatDialogRef<AddMemberDialog>,
    private routerExtensions: RouterExtensionsService,
  ) {}

  ngOnInit() {
    this.loadParamsFromUrl();

    const { workspaceId, projectId } = this.data;
    this.form.patchValue({ workspaceId, projectId });
  }

  loadParamsFromUrl() {
    const { workspaceId, projectId } = this.routerExtensions.snapshot.params;
    this.data.workspaceId = this.data.workspaceId || Number(workspaceId);
    this.data.projectId = this.data.projectId || Number(projectId);
  }

  addMembers() {
    const formValues = this.form.value;

    this.form.markAllAsTouched();
    this.form.updateValueAndValidity();

    if (this.form.invalid) return;

    this.dialogRef.close([formValues.email]);
  }

  cancel() {
    this.dialogRef.close(false);
  }
}

import { Component, HostBinding, Inject } from '@angular/core';
import { MatDialogRef, MAT_DIALOG_DATA } from '@angular/material/dialog';

/**
 * Type of the dialog variant. Used to specify what dialog styling should be used.
 */
export enum AlertDialogVariant {
  DEFAULT = 'default',
  IMPORTANT = 'important',
}

/**
 * Alert dialog data interface. Indicates what data will be passed to the dialog.
 */
export interface AlertDialogData {
  /**
   * Dialog title. Displayed at the top of the dialog.
   */
  title?: string;
  /**
   * Dialog message. Displayed below the title.
   */
  message?: string;
  /**
   * Confirm button text.
   */
  confirmText?: string;
  /**
   * Cancel button text.
   */
  cancelText?: string;
  /**
   * Type of the dialog variant. Used to specify what dialog styling should be used.
   */
  variant?: AlertDialogVariant;
}

/**
 * Alert dialog component. Simple dialog with a title, message, and configurable buttons.
 */
@Component({
  selector: 'app-alert-dialog',
  templateUrl: './alert.dialog.html',
  styleUrls: ['./alert.dialog.scss'],
})
export class AlertDialog {
  /**
   * Passthrough to the dialog's variant enumerable.
   */
  public AlertDialogVariant = AlertDialogVariant;

  /**
   * Default constructor. Injects the dialog reference and data.
   * @param data Object to pass as data to the dialog
   * @param dialogRef Reference to dialog instance
   */
  constructor(
    @Inject(MAT_DIALOG_DATA) public data: AlertDialogData,
    private dialogRef: MatDialogRef<AlertDialog>,
  ) {
    data.variant ||= AlertDialogVariant.DEFAULT;
  }

  /**
   * Host binding to set if the dialog is important.
   */
  @HostBinding('class.important-dialog') important: boolean =
    this.data.variant === AlertDialogVariant.IMPORTANT;

  /**
   * Closes the dialog. Returns false to indicate that the dialog was closed without confirmation.
   */
  cancel() {
    this.dialogRef.close(false);
  }

  /**
   * Closes the dialog. Returns true to indicate that the dialog was closed with confirmation.
   */
  confirm() {
    this.dialogRef.close(true);
  }
}

import { EMOJI_SEQUENCE_REGEX } from '@main/libs/emoji/emoji-sequence.aliases';
import { Emoji } from '@main/libs/emoji/emoji.lib';
import { marked } from 'marked';

interface EmojiToken {
  type: 'emoji';
  raw: string;
  emoji: string;
  emojiType: 'sequence' | 'colon';
}

/**
 * Emoji extension to use with `marked` parser
 *
 * Replaces only `:smile:` notation
 */
export const emoji = {
  name: 'emoji',
  level: 'inline', // This is an inline-level tokenizer
  start(src: string) {
    return src.indexOf(':');
  }, // Hint to Marked.js to stop and check for a match
  tokenizer(src: string, _tokens: any) {
    const rule = /^:(\w+):/; // Regex for the complete token, anchor to string start
    const match = rule.exec(src);

    const matchSequence = EMOJI_SEQUENCE_REGEX.exec(src);

    if (matchSequence) {
      return {
        type: 'emoji',
        raw: matchSequence[0],
        emoji: matchSequence[1],
        emojiType: 'sequence',
      };
    }

    if (match) {
      return {
        // Token to generate
        type: 'emoji', // Should match "name" above
        raw: match[0], // Text to consume from the source
        emoji: match[1], // Additional custom properties
        emojiType: 'colon',
      };
    }

    return undefined;
  },
  renderer(token: EmojiToken): string {
    const convertFunction =
      token.emojiType === 'colon' ? Emoji.emojiNameToUnicode : Emoji.characterSequenceToUnicode;
    const convertedEmoji = convertFunction(token.emoji);

    return `<span class="emoji">${convertedEmoji}</span>`;
  },
} as marked.TokenizerExtension & marked.RendererExtension;

import { DialogService } from '@main/services/dialog.service';
import { Observable } from 'rxjs';

export interface ErrorValidationTree {
  [key: string]: {
    [key: number]: string;
  };
}

export function ServiceValidator(errorValidationTree: ErrorValidationTree) {
  return function (target: any, propertyKey: string, descriptor: PropertyDescriptor) {
    descriptor.value = function (identifier: string) {
      // const result = originalMethod.apply(this, identifier);

      // This function returns new observable to use it as a pipe in other observables
      return <T = any>(source: Observable<T>) => {
        // Check for match in response
        const match = (response: any) => {
          // identifier check
          if (!errorValidationTree[identifier]) return;

          // Status check
          const status = response?.error?.status || response?.status;
          if (!status) return;

          return errorValidationTree[identifier][status] || null;
        };

        const showAlert = (message: string, responseType: 'SUCCESS' | 'ERROR') => {
          const dialogService = (window as any).injector.get(DialogService);

          dialogService.alert({
            title:
              responseType === 'SUCCESS' ? $localize`Success` : $localize`Something went wrong`,
            message,
            cancelText: $localize`OK`,
          });
        };

        return new Observable<any>((subscriber) => {
          source.subscribe({
            next(value) {
              const m = match(value);

              if (m) {
                showAlert(m, 'ERROR');
              } else {
                subscriber.next(value);
              }
            },
            error(error) {
              const m = match(error);

              if (m) {
                showAlert(m, 'ERROR');
              } else {
                subscriber.error(error);
              }
            },
            complete() {
              subscriber.complete();
            },
          });
        });
      };
    };

    return descriptor;
  };
}

import { NgControl } from '@angular/forms';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MainModule } from '@main/_main.module';
import { Meta, moduleMetadata } from '@storybook/angular';
import { NgModuleMetadata } from '@storybook/angular/dist/ts3.9/client/preview/types';
import { merge } from 'lodash-es';
import { getAllProperties } from '../functions/get-all-properties.function';

export interface ExtendedMeta extends Meta {
  metadata?: Partial<NgModuleMetadata>;
  selector: string;
}

const DEFAULT_METADATA: Partial<NgModuleMetadata> = {
  imports: [MainModule, BrowserAnimationsModule],
  providers: [NgControl],
};

const IGNORED_PROPERTIES = getAllProperties({});

export class StoryPageConfig {
  private _meta: ExtendedMeta;

  constructor(meta: ExtendedMeta) {
    this._meta = meta;

    this._meta.decorators = [moduleMetadata(merge({}, DEFAULT_METADATA, this._meta.metadata))];
    this.disableEditingFunctions();
  }

  private disableEditingFunctions() {
    if (!this._meta.argTypes) {
      this._meta.argTypes = {};
    }

    const properties = getAllProperties(this._meta.component.prototype);
    console.log(properties);
    for (const [property, predicate] of properties.map(
      (p) => [p, this.propertyPredicate(p)] as [string, any],
    )) {
      if (typeof this._meta.component.prototype[property] === 'function') {
        switch (predicate) {
          case 'delete':
            this._meta.argTypes[property] = { table: { disable: true } };
            break;
          case 'readonly':
            this._meta.argTypes[property] = { control: false };
            break;
        }
      }
    }
  }

  private propertyPredicate(property: string) {
    if (property[0] === '_') return 'delete';
    if (property.startsWith('ng')) return 'delete';
    return !IGNORED_PROPERTIES.includes(property) ? 'readonly' : null;
  }

  public setTitle(title: string) {
    this._meta.title = title;
    return this;
  }

  public addDecorators(decorators: Meta['decorators']) {
    if (!this._meta.decorators) {
      this._meta.decorators = [];
    }

    this._meta.decorators = ([] as any[]).concat(this._meta.decorators, decorators);
    return this;
  }

  public get selector() {
    return this._meta.selector;
  }

  public meta() {
    return this._meta as Meta;
  }
}

