import { Injectable, Injector } from '@angular/core';
import { MatDialog, MatDialogRef } from '@angular/material/dialog';
import { Project } from '@dashboard/interfaces/project.interface';
import { Workspace } from '@dashboard/interfaces/workspace.interface';
import { DialogRef } from '@main/classes/dialog-ref.class';
import { BehaviorSubject, filter } from 'rxjs';
import { v4 as uuid } from 'uuid';
import { Service } from '../decorators/service.decorator';
import { AlertDialog, AlertDialogData, AlertDialogVariant } from '../dialogs/alert/alert.dialog';

export enum DialogOutlet {
  CONTENT_RIGHT = 'CONTENT_RIGHT',
}

/**
 * Service to manage dialogs.
 */
@Service()
@Injectable({
  providedIn: 'root',
})
export class DialogService {
  private dialogsMap = new Map();
  private dialogs$ = new BehaviorSubject<Map<number, MatDialogRef<unknown, any> | DialogRef>>(
    this.dialogsMap,
  );
  private outlets = new Map<DialogOutlet, any>();

  public get isAnyDialogOpen() {
    return this.dialogs$.getValue().size > 0;
  }
  /**
   * Default constructor with `MatDialog` dependency.
   * @param matDialog MatDialog instance
   */
  constructor(private matDialog: MatDialog, private injector: Injector) {}

  /**
   * Opens a modal dialog containing the given component.
   * @param component Type of the component to load into the dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  open(component: any, data: any, outlet?: DialogOutlet): MatDialogRef<any> | DialogRef {
    console.log();

    let dialog: MatDialogRef<any> | DialogRef;

    if (outlet) {
      const outletComponent = this.outlets.get(outlet);

      if (!outletComponent)
        throw new Error(
          `${outlet} is not assigned to any dialog outlet component, you need to call registerOutlet()`,
        );

      dialog = outletComponent.renderDialog(component, data);
    } else {
      dialog = this.matDialog.open(component, {
        data,
        width: '400px',
      });
    }

    const uid = uuid();
    this.dialogsMap.set(uid, dialog);

    dialog.afterClosed().subscribe(() => {
      this.dialogsMap.delete(uid);
      this.dialogs$.next(this.dialogsMap);
    });

    this.dialogs$.next(this.dialogsMap);

    return dialog;
  }

  closeAll() {
    this.dialogsMap.forEach((dialog) => {
      dialog.close();
    });
  }

  registerOutlet(outlet: DialogOutlet, component: any) {
    this.outlets.set(outlet, component);
  }

  /**
   * Opens a alert/information dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  alert(data: AlertDialogData) {
    return this.open(AlertDialog, data)
      .afterClosed()
      .pipe(filter((result) => result));
  }

  openErrorDialog(error: string) {
    const data: AlertDialogData = {
      title: 'Error',
      message: error,
      variant: AlertDialogVariant.IMPORTANT,
      cancelText: $localize`Close`,
    };
    return this.alert(data);
  }

  /**
   * Opens a confirm dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  confirm(data: AlertDialogData) {
    return this.alert(data);
  }

  confirmProjectDelete(project: Project) {
    return this.confirm({
      title: $localize`Delete project "${project.name}"`,
      message: $localize`Are you sure you want to delete project "${project.name}"?`,
      confirmText: $localize`Delete`,
      cancelText: $localize`Cancel`,
      variant: AlertDialogVariant.IMPORTANT,
    });
  }

  confirmWorkspaceDelete(workspace: Workspace) {
    return this.confirm({
      title: $localize`Delete workspace "${workspace.name}"`,
      message: $localize`Are you sure you want to delete this workspace "${workspace.name}"?`,
      confirmText: $localize`Delete`,
      cancelText: $localize`Cancel`,
      variant: AlertDialogVariant.IMPORTANT,
    });
  }
}

import { Injectable } from '@angular/core';
import { GitAccount, GitIntegration } from '@dashboard/interfaces/git-integration.interface';
import { Project } from '@dashboard/interfaces/project.interface';
import { Service } from '@main/decorators/service.decorator';
import { ApiService } from '@main/services/api.service';
import { filter, interval, map, mergeMap, Observable, take } from 'rxjs';
import { ProjectService } from './project.service';

/**
 * How to use Git integration service:
 *
 * 1. Run method `startGitHubIntegration()` to start the integration process and open the browser to the GitHub login page.
 *
 *
 */
@Service()
@Injectable({
  providedIn: 'root',
})
export class GitIntegrationService {
  constructor(private apiService: ApiService, private projectService: ProjectService) {}

  /**
   * Start GitHub integration process - opens the GitHub page in new window, to give user ability to choose witch account and repositories wants to give access to.
   * @example this.gitHubIntegrationService.startGitHubIntegration()
   * @returns Observable<boolean> true if the opened window with GitHub integration was closed
   */
  public startGitHubIntegration(): Observable<boolean> {
    return this.apiService.get('/user/integration/github/repository').pipe(
      map((response: any) => response.link),
      mergeMap((url) => {
        const win = window.open(url, '_blank');

        if (!win) throw new Error('This browser does not support window.open');

        return interval(100).pipe(
          map(() => win.closed),
          filter((closed) => closed),
          take(1),
        );
      }),
    );
  }

  public postGitHubIntegration(installationId: string): Observable<void> {
    return this.apiService.post(`/user/integration/github`, {
      params: { installationId },
    });
  }

  public getGitHubIntegration(): Observable<GitIntegration> {
    return this.apiService.get('/user/integration/github/repository');
  }

  public attachGitHubIntegration(projectId: number, repositoryName: string): Observable<void> {
    return this.apiService.post(`/project/${projectId}/integration/github`, {
      body: repositoryName,
    });
  }

  public getConnectedGitHubAccounts(): Observable<GitAccount[]> {
    return this.apiService
      .get('/user/integration/github')
      .pipe(
        map((accounts: GitAccount[]) =>
          accounts.map((account) => ({ ...account, gitHubUsername: `@${account.gitHubUsername}` })),
        ),
      );
  }

  /**
   * Delete the given account connection
   * @param gitHubAccountId GitHub account id
   * @returns object with link to open the GitHub page with application removal
   */
  public deleteConnectedGitHubAccount(gitHubAccountId: number): Observable<{ link: string }> {
    return this.apiService.delete(`/user/integration/github/${gitHubAccountId}`);
  }

  public deleteGitHubIntegration(projectId: number): Observable<void> {
    return this.apiService.delete(`/project/${projectId}/integration/github`);
  }

  public hasGitHubIntegration(projectId: number): Observable<boolean> {
    return this.projectService.get(projectId).pipe(map((project) => !!project.gitHubIntegration));
  }

  public gitHubIssueList(projectId: number) {
    return this.apiService.get(`/project/${projectId}/integration/git/issue`);
  }

  public gitHubPullList(projectId: number) {
    return this.apiService.get(`/project/${projectId}/integration/git/pull`);
  }

  /**
   * Checks if the given account is the owner of the repository
   * @param repositoryName Repository name with it's owner ex. @czemar/cli
   * @param account GitHub account object to test with
   * @example this.gitHubIntegrationService.isOwnerOfRepository('@czemar/cli', account)
   * @returns true if the repository is owned by the account
   */
  public isOwnerOfRepository(repositoryName: string, account: GitAccount): boolean {
    const preparedUsername = account.gitHubUsername.replace('@', '');
    return Boolean(repositoryName.match(new RegExp('^' + preparedUsername + '/*')));
  }

  public getGitHubAccountConnectedProjects(account: GitAccount): Observable<Project[]> {
    return this.projectService
      .list()
      .pipe(
        map((projects) =>
          projects.filter(
            (project: Project) =>
              project.gitHubIntegration &&
              this.isOwnerOfRepository(project.gitHubIntegration, account),
          ),
        ),
      );
  }
}

import { Injectable } from '@angular/core';
import { ProjectMember } from '@dashboard/interfaces/project-member.interface';
import { Service } from '@main/decorators/service.decorator';
import { map, Observable } from 'rxjs';
import { ApiService } from 'src/app/_main/services/api.service';

@Service()
@Injectable({
  providedIn: 'root',
})
export class MemberService {
  constructor(private apiService: ApiService) {}

  /**
   * Lists members in given project
   * @param projectId project which are members from
   * @returns Request observable, which completes when request is finished
   */
  public list(projectId: number): Observable<ProjectMember[]> {
    return this.apiService.get(`/project/${projectId}/member`);
  }

  /**
   * Removes members from project
   * @param projectId project which are members from
   * @param id list of member ids to remove from project
   * @returns Request observable, which completes when request is finished
   */
  public remove(projectId: number, id: number[]): Observable<ProjectMember[]> {
    return this.apiService.put(`/project/${projectId}/member`, { body: id });
  }

  /**
   * Let member leave project.
   * @param projectId project which are members from
   * @param id id of the member who will leave the project
   * @returns Request observable, which completes when request is finished
   */
  public leave(projectId: number, id: number): Observable<null> {
    return this.apiService.delete(`/project/${projectId}/member`, { body: id });
  }

  /**
   * Adds members to projects.
   * @param emails emails of people to add
   * @param projectList projects where people will be added
   * @returns Request observable, which completes when request is finished
   */
  public add(
    emails: string[],
    projects: number[],
  ): Observable<{ emails: string[]; projectList: number[] }> {
    return this.apiService.post(`/project/member`, { body: { emails, projects } });
  }

  /**
   * Creates members map from given project
   * @param projectId project which are members from
   * @returns Request observable, which completes when request is finished
   */
  public map(projectId: number): Observable<Map<number, ProjectMember>> {
    return this.list(projectId).pipe(
      map((members) =>
        members.reduce((acc: Map<number, ProjectMember>, member: ProjectMember) => {
          acc.set(member.user.id, member);
          return acc;
        }, new Map<number, ProjectMember>()),
      ),
    );
  }
}

