import * as monaco from 'monaco-editor';

type MonacoEditor = monaco.editor.IStandaloneCodeEditor;
type Selection = monaco.Selection;
type EditOperation = monaco.editor.IIdentifiedSingleEditOperation;

interface SelectionEditOperation {
  before?: string;
  after?: string;
  beforeEachLine?: string;
  afterEachLine?: string;
}

export class MonacoExtended {
  public static insertTextAt(
    editor: MonacoEditor,
    lineNumber: number,
    column: number,
    text: string,
  ) {
    editor.executeEdits('', [
      {
        range: {
          startLineNumber: lineNumber,
          startColumn: column,
          endLineNumber: lineNumber,
          endColumn: column,
        },
        text,
      },
    ]);
  }

  public static executeEdits(editor: MonacoEditor, edits: EditOperation[]) {
    for (const edit of edits) {
      if (edit.range?.startColumn && !edit.range?.endColumn)
        (edit.range as any).endColumn = edit.range.startColumn;
      if (edit.range?.startLineNumber && !edit.range?.endLineNumber)
        (edit.range as any).endLineNumber = edit.range.startLineNumber;
    }
    return editor.executeEdits('', edits);
  }

  public static removeTextAt(
    editor: MonacoEditor,
    startLineNumber: number,
    startColumn: number,
    endLineNumber: number,
    endColumn: number,
  ) {
    editor.executeEdits('', [
      {
        range: {
          startLineNumber,
          startColumn,
          endLineNumber,
          endColumn,
        },
        text: null,
      },
    ]);
  }

  public static insertTextBeforeSelection(
    editor: MonacoEditor,
    selection: Selection,
    text: string,
  ) {
    MonacoExtended.insertTextAt(editor, selection.startLineNumber, selection.startColumn, text);
  }

  public static insertTextAfterSelection(editor: MonacoEditor, selection: Selection, text: string) {
    MonacoExtended.insertTextAt(editor, selection.endLineNumber, selection.endColumn, text);
  }

  public static insertTextBeforeAndAfterEachSelection(
    editor: MonacoEditor,
    selections: Selection[],
    beforeSelectionText: string,
    afterSelectionText: string = '',
  ) {
    const edits = ([] as any[]).concat(
      ...selections.map((selection) => {
        return [
          {
            range: {
              startLineNumber: selection.startLineNumber,
              startColumn: selection.startColumn,
              endLineNumber: selection.startLineNumber,
              endColumn: selection.startColumn,
            },
            text: beforeSelectionText,
          },
          {
            range: {
              startLineNumber: selection.endLineNumber,
              startColumn: selection.endColumn,
              endLineNumber: selection.endLineNumber,
              endColumn: selection.endColumn,
            },
            text: afterSelectionText,
          },
        ];
      }),
    );

    editor.executeEdits('', edits);
  }

  public static removeTextBeforeAndAfterEachSelection(
    editor: MonacoEditor,
    selections: Selection[],
    beforeSelectionText: string,
    afterSelectionText: string = '',
  ) {
    const model = editor.getModel();
    const afterSelectionTextLinesCount = (afterSelectionText.match(/\n/g) || [])?.length;
    const edits: any[] = [];

    if (!model) return;

    for (const selection of selections) {
      if (
        MonacoExtended.selectionStartWith(editor, selection, beforeSelectionText) &&
        MonacoExtended.selectionEndsWith(editor, selection, afterSelectionText)
      ) {
        edits.push({
          range: {
            startLineNumber: selection.startLineNumber,
            startColumn: selection.startColumn,
            endLineNumber:
              selection.startLineNumber + (beforeSelectionText.match(/\n/g) || [])?.length,
            endColumn: beforeSelectionText.replace(/.*\n/g, '').length + 1,
          },
          text: '',
        });
        edits.push({
          range: {
            startLineNumber: selection.endLineNumber - afterSelectionTextLinesCount,
            startColumn:
              model.getLineContent(selection.endLineNumber - afterSelectionTextLinesCount).length -
              (afterSelectionText.replace(/\n[^]*$/g, '').length - 1),
            endLineNumber: selection.endLineNumber,
            endColumn: selection.endColumn,
          },
          text: '',
        });
      }
    }

    editor.executeEdits('', edits);
  }

  public static selectionStartWith(editor: MonacoEditor, selection: Selection, text: string) {
    const selectedValue = editor
      .getModel()
      ?.getValueInRange(selection, monaco.editor.EndOfLinePreference.LF);
    return selectedValue?.startsWith(text);
  }

  public static selectionEndsWith(editor: MonacoEditor, selection: Selection, text: string) {
    const selectedValue = editor
      .getModel()
      ?.getValueInRange(selection, monaco.editor.EndOfLinePreference.LF);
    return selectedValue?.endsWith(text);
  }

  public static toggleEndAndStartOfEachSelection(
    editor: MonacoEditor,
    beforeSelectionText: string,
    afterSelectionText: string = '',
  ) {
    const selections = editor.getSelections();
    if (!selections) return;

    const shouldDelete = selections.some(
      (selection) =>
        MonacoExtended.selectionStartWith(editor, selection, beforeSelectionText) &&
        MonacoExtended.selectionEndsWith(editor, selection, afterSelectionText),
    );

    const mode: 'delete' | 'add' = shouldDelete ? 'delete' : 'add';

    if (mode === 'delete') {
      MonacoExtended.removeTextBeforeAndAfterEachSelection(
        editor,
        selections,
        beforeSelectionText,
        afterSelectionText,
      );
    } else {
      MonacoExtended.insertTextBeforeAndAfterEachSelection(
        editor,
        selections,
        beforeSelectionText,
        afterSelectionText,
      );
    }
  }
}

export interface PersistentMapOptions {
  persistentKey: string;
}

export class PersistentMap<K, V> extends Map<K, V> {
  override clear(): void {
    localStorage.removeItem(this._persistentKey);
    super.clear();
  }

  override delete(key: K): boolean {
    const temp = super.delete(key);
    this.saveState();
    return temp;
  }

  override set(key: K, value: V): this {
    const temp = super.set(key, value);
    this.saveState();
    return temp;
  }

  private saveState() {
    localStorage.setItem(this._persistentKey, JSON.stringify([...this.entries()]));
  }

  private _persistentKey = '';

  constructor(
    { persistentKey }: PersistentMapOptions,
    entries?: readonly (readonly [K, V])[] | null,
  ) {
    super(
      persistentKey && localStorage.getItem(persistentKey)
        ? JSON.parse(localStorage.getItem(persistentKey)!)
        : entries,
    );

    if (!persistentKey) {
      console.error('PersistentMap need persistentKey option');
      return;
    }

    this._persistentKey = persistentKey;
  }
}

export class Random {
  private m_w = 123456789;
  private m_z = 987654321;
  private mask = 0xffffffff;

  /**
   * Random number generation class with optional seed
   * @param seed the seed to use in random number generation
   */
  constructor(seed: number = new Date().getTime()) {
    this.m_w = (123456789 + seed) & this.mask;
    this.m_z = (987654321 - seed) & this.mask;
  }

  // Returns number between 0 (inclusive) and 1.0 (exclusive),
  // just like Math.random().
  public random() {
    this.m_z = (36969 * (this.m_z & 65535) + (this.m_z >> 16)) & this.mask;
    this.m_w = (18000 * (this.m_w & 65535) + (this.m_w >> 16)) & this.mask;
    let result = ((this.m_z << 16) + (this.m_w & 65535)) >>> 0;
    result /= 4294967296;
    return result;
  }
}

import { snakeCase } from 'lodash-es';
import { CursorSTateComputer, EditOperation, Editor, Selection } from '../typings';

export type SelectionEditOperation = { [key in SelectionEditOperationType]: string };

export enum SelectionEditOperationType {
  before = 'BEFORE',
  after = 'AFTER',
  beforeEachLine = 'BEFORE_EACH_LINE',
  afterEachLine = 'AFTER_EACH_LINE',
}

export const SelectionEditOperationOrder = {
  before: 1,
  after: 4,
  beforeEachLine: 2,
  afterEachLine: 3,
};

const SelectionEditOperationConverter: {
  [key in SelectionEditOperationType]: (
    editor: Editor,
    selection: Selection,
    value: string,
  ) => EditOperation[];
} = {
  [SelectionEditOperationType.before]: (editor: Editor, selection: Selection, value: string) => {
    return [
      {
        range: {
          startColumn: 1,
          startLineNumber: selection.startLineNumber,
          endColumn: 1,
          endLineNumber: selection.startLineNumber,
        },
        text: value,
      },
    ] as EditOperation[];
  },
  [SelectionEditOperationType.after]: (editor: Editor, selection: Selection, value: string) => {
    const column = (editor.getModel()?.getLineLength(selection.endLineNumber) || 0) + 1;

    return [
      {
        range: {
          startColumn: column,
          startLineNumber: selection.endLineNumber,
          endColumn: column,
          endLineNumber: selection.endLineNumber,
        },
        text: value,
      },
    ] as EditOperation[];
  },
  [SelectionEditOperationType.beforeEachLine]: (
    editor: Editor,
    selection: Selection,
    value: string,
  ) => {
    const startLine = selection.startLineNumber;
    const endLine = selection.endLineNumber;

    const difference = Math.abs(startLine - endLine) + 1;
    const offset = Math.min(startLine, endLine);
    const indexes = [...new Array(difference).keys()].map((k) => k + offset);

    return indexes.map((line) => ({
      range: {
        startLineNumber: line,
        startColumn: 1,
        endLineNumber: line,
        endColumn: 1,
      },
      text: value,
    })) as EditOperation[];
  },
  [SelectionEditOperationType.afterEachLine]: (
    editor: Editor,
    selection: Selection,
    value: string,
  ) => {
    const model = editor.getModel();
    if (!model) return [];

    const startLine = selection.startLineNumber;
    const endLine = selection.endLineNumber;

    const difference = Math.abs(startLine - endLine) + 1;
    const offset = Math.min(startLine, endLine);
    const indexes = [...new Array(difference).keys()].map((k) => k + offset);

    return indexes.map((line) => {
      const column = model.getLineLength(line) + 1;

      return {
        range: {
          startLineNumber: line,
          startColumn: column,
          endLineNumber: line,
          endColumn: column,
        },
        text: value,
      } as EditOperation;
    });
  },
};

export class SelectionEditPlugin {
  public static init(prototype: any) {
    prototype.getSelectionEdits = function (edits: SelectionEditOperation) {
      return SelectionEditPlugin.getSelectionEdits.bind(this)(edits);
    };

    prototype.executeSelectionEdits = function (
      edits: SelectionEditOperation,
      endCursorState?: CursorSTateComputer | Selection[],
    ) {
      return SelectionEditPlugin.executeSelectionEdits.bind(this)(edits, endCursorState);
    };
  }

  public static getSelectionEdits(edits: SelectionEditOperation): EditOperation[] {
    const editor: Editor = this as any;
    console.log(editor);
    const selections = editor.getSelections();
    let _edits: EditOperation[] = [];

    console.log(selections);

    if (!selections) return [];

    for (const selection of selections) {
      const entries = Object.entries(edits).sort((a: [string, string], b: [string, string]) => {
        return (
          (SelectionEditOperationOrder as any)[a[0] as any] -
          (SelectionEditOperationOrder as any)[b[0] as any]
        );
      });
      for (const [key, value] of entries) {
        const _key = snakeCase(key).toUpperCase();
        _edits = [
          ..._edits,
          ...SelectionEditOperationConverter[_key as SelectionEditOperationType](
            editor,
            selection,
            value,
          ),
        ];
      }
    }
    return _edits;
  }

  public static executeSelectionEdits(
    edits: SelectionEditOperation,
    endCursorState?: CursorSTateComputer | Selection[],
  ) {
    const editor: Editor = this as any;
    const _edits = this.getSelectionEdits(edits);
    console.log(_edits);
    editor.executeEdits('', _edits, endCursorState);
  }
}

import { FormControl } from '@angular/forms';
import { componentWrapperDecorator } from '@storybook/angular';
import { merge, omit } from 'lodash-es';
import { exposeAllPossibilities } from '../component-content-decorator.helper';
import { StoryPageConfig } from './story-page-config.class';
import { StoryTemplate } from './story-template.class';
import { StoryFn } from '@storybook/angular';
import { componentTemplateDecorator } from '../functions/component-template-decorator.function';

export type Props<C> = Partial<C> & {
  formControl?: FormControl;
  content?: string;
};

export interface StoryConfig<C> {
  config: StoryPageConfig;
  template: StoryTemplate<C>;
  description?: string;
  multiple?: {
    prop: string;
    options: any[];
  };
  props?: Props<C>;
  code?: string;
  html?: string;
}

export class Story<C> {
  private _config: StoryConfig<C>;
  private _story: StoryFn<C>;

  constructor(config: StoryConfig<C>) {
    this._config = config;
    this._story = config.template.template();

    if (config.multiple) {
      exposeAllPossibilities(
        this._story,
        config.config.selector,
        config.multiple.prop,
        config.multiple.options,
      );
    }

    if (config.description) {
      this.addDescription(config.description);
    }

    if (config.code) {
      this.addCode(config.code);
    }

    if (config.html) {
      this.addTemplate(config.html);
    } else if (!config.multiple) {
      this.addDefaultTemplate();
    }

    if (this.props) {
      this.addProps(this.props);
    }
  }

  public mergeConfig(config: any) {
    merge(this._story, config);
  }

  public addDescription(description: string) {
    this.mergeConfig({
      parameters: {
        docs: {
          description: {
            story: description,
          },
        },
      },
    });
  }

  public addProps(props: Props<C>) {
    this.mergeConfig({
      args: omit(props, ['content']),
    });
  }

  public addCode(code: string) {
    this.mergeConfig({
      parameters: {
        docs: {
          source: {
            code: code,
            language: 'html',
            type: 'auto',
          },
        },
      },
    });
  }

  public addTemplate(template: string) {
    this.mergeConfig({
      decorators: [componentWrapperDecorator(() => template)],
      parameters: {
        docs: {
          source: {
            code: template,
            language: 'html',
            type: 'auto',
          },
        },
      },
    });
  }

  public addDefaultTemplate() {
    this.mergeConfig({
      decorators: [
        componentTemplateDecorator(this.props, {
          selector: this._config.config.selector,
        }),
      ],
    });
  }

  public get props() {
    return merge({}, this._config.props, this._config.template.props);
  }

  public story() {
    return this._story;
  }
}

import { NgControl } from '@angular/forms';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MainModule } from '@main/_main.module';
import { Meta, moduleMetadata } from '@storybook/angular';
import { NgModuleMetadata } from '@storybook/angular/dist/ts3.9/client/preview/types';
import { merge } from 'lodash-es';
import { getAllProperties } from '../functions/get-all-properties.function';

export interface ExtendedMeta extends Meta {
  metadata?: Partial<NgModuleMetadata>;
  selector: string;
}

const DEFAULT_METADATA: Partial<NgModuleMetadata> = {
  imports: [MainModule, BrowserAnimationsModule],
  providers: [NgControl],
};

const IGNORED_PROPERTIES = getAllProperties({});

export class StoryPageConfig {
  private _meta: ExtendedMeta;

  constructor(meta: ExtendedMeta) {
    this._meta = meta;

    this._meta.decorators = [moduleMetadata(merge({}, DEFAULT_METADATA, this._meta.metadata))];
    this.disableEditingFunctions();
  }

  private disableEditingFunctions() {
    if (!this._meta.argTypes) {
      this._meta.argTypes = {};
    }

    const properties = getAllProperties(this._meta.component.prototype);
    console.log(properties);
    for (const [property, predicate] of properties.map(
      (p) => [p, this.propertyPredicate(p)] as [string, any],
    )) {
      if (typeof this._meta.component.prototype[property] === 'function') {
        switch (predicate) {
          case 'delete':
            this._meta.argTypes[property] = { table: { disable: true } };
            break;
          case 'readonly':
            this._meta.argTypes[property] = { control: false };
            break;
        }
      }
    }
  }

  private propertyPredicate(property: string) {
    if (property[0] === '_') return 'delete';
    if (property.startsWith('ng')) return 'delete';
    return !IGNORED_PROPERTIES.includes(property) ? 'readonly' : null;
  }

  public setTitle(title: string) {
    this._meta.title = title;
    return this;
  }

  public addDecorators(decorators: Meta['decorators']) {
    if (!this._meta.decorators) {
      this._meta.decorators = [];
    }

    this._meta.decorators = ([] as any[]).concat(this._meta.decorators, decorators);
    return this;
  }

  public get selector() {
    return this._meta.selector;
  }

  public meta() {
    return this._meta as Meta;
  }
}

import { merge } from 'lodash-es';
import { Props } from './story.class';

export class StoryTemplate<C> {
  private _args: Props<C>;

  constructor(args: Props<C>) {
    const controlObject = args.formControl ? { formControl: args.formControl } : {};
    this._args = merge({}, controlObject, args);
  }

  public get props() {
    return this._args;
  }

  public template() {
    return ((args: C) => ({
      props: merge({}, args),
    })).bind({});
  }
}

