@Component({
  selector: 'app-input-date-time',
  templateUrl: './input-date-time.component.html',
  styleUrls: ['./input-date-time.component.scss'],
})
export class InputDateTimeComponent extends ControlAccessor implements OnInit {
  @Input()
  placeholder: string = '';

